            url: "https://music.apple.com/us/artist/jain/334329603",
            artistBio:
              "French pop singer, songwriter, and producer Jain dominates the charts with music boasting cultural influences from France, the Middle East, and the Congo.\n\n• Though Jain was born in France, her father’s work in the oil industry took her family around the world. At nine years old, she moved to Dubai, and three years later, she moved to the Congo.  \n• While in the Congo, Jain met French producer Mr. Flash, who introduced her to music production. She began uploading demo tracks to MySpace and was soon discovered by French artist Yodelice.\n• After moving back to France, she issued her Yodelice-produced debut EP, <i>Hope</i>, in 2015. Her smash hit “Come” went diamond in France and platinum in Italy and Poland.\n• Later in 2015, Jain delivered her debut album, <i>Zanaka</i>, which hit the Top 5 on the French and Belgian charts and went diamond in France.\n• In 2017, Jain won Best French Act at the European Border Breaker Awards and Female Artist of the Year at the Victoires de la Musique.\n• “Makeba,” a <i>Hope</i> single named after South African singer and activist Miriam Makeba, eventually received a Grammy nomination for Best Music Video in 2018. \n• Jain’s 2018 sophomore album, <i>Souldier</i>, reached No. 1 on the French charts and was one of the 50 best-selling albums in the country that year.",
