const fakeApiSlice = createSlice({
  name: "fake api",
  initialState,
  reducers: {
    getFakeSongsByGenre: (state, action) => {
      const { payload } = action;
      state.data = state.allData?.discover[payload];
    },
    getFakeTopCharts: (state) => {
      state.data = state.allData?.topCharts;
    },
    getFakeSongsByCountry: (state, action) => {
      const { payload } = action;
      state.data = state.allData[payload];
    },
    getFakeArtistDetails: (state, action) => {
      state.artist = state.allData?.artistData;
    },
    getFakeSearch: (state, action) => {
      state.artist = state.allData?.searchData;
    },
  },
});

export const {
  getFakeSongsByGenre,
  getFakeTopCharts,
  getFakeSongsByCountry,
  getFakeArtistDetails,
  getFakeSearch,
} = fakeApiSlice.actions;

export default fakeApiSlice.reducer;
